import React, { Component, useState } from "react";
import { withAuth } from "utils/auth";

class SecurePage extends Component {
  render() {
    return (
      <div style={{ maxWidth: "600px", margin: "auto" }}>
        <h1 style={{ textAlign: "center", marginBottom: "20px", color: "#333" }}>Secure Page</h1>
        <div style={{ border: "1px solid #ccc", borderRadius: "5px", padding: "20px", backgroundColor: "#f9f9f9", boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.1)" }}>
          <div style={{ textAlign: "center", marginBottom: "20px", fontSize: "1.2rem" }}>
            You can only access this page if you are logged in.
          </div>
          <div style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
            <div style={{ marginBottom: "10px" }}>
              <label>Email:</label> user@example.com
            </div>
            <div style={{ marginBottom: "10px" }}>
              <label>Password:</label>{" "}
              <PasswordWithVisibilityToggle />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

// Component for Password with visibility toggle
const PasswordWithVisibilityToggle = () => {
  const [showPassword, setShowPassword] = useState(false);

  const togglePasswordVisibility = () => {
    setShowPassword(!showPassword);
  };

  return (
    <div style={{ display: "flex", alignItems: "center" }}>
      <input
        type={showPassword ? "text" : "password"}
        value={showPassword ? "password123" : "*********"}
        readOnly
        style={{ flex: 1, padding: "10px", border: "1px solid #ccc", borderRadius: "5px", marginRight: "5px" }}
      />
      <button onClick={togglePasswordVisibility} style={{ padding: "10px 20px", borderRadius: "5px", cursor: "pointer", backgroundColor: "#007bff", color: "#fff", border: "none" }}>
        {showPassword ? "Hide" : "Show"}
      </button>
    </div>
  );
};

export default withAuth(SecurePage);
